var title_f33_3_33843="Abdomen aorta flow reversal AR";
var content_f33_3_33843=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F55026&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F55026&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 519px\">",
"   <div class=\"ttl\">",
"    Diastolic flow reversal in the descending abdominal aorta in aortic regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 499px; height: 353px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Using a subcostal window, just to the left of the midline, the pulse wave Doppler (PWD) sample volume from the abdominal aorta (ABAO) viewed in its long axis (panel A). In severe aortic regurgitation, the reverse diastolic flow component is almost equal in size to the forward flow signal (panel B). However, the net forward flow is actually greater than the reversed flow because the diameter of the aorta in systole is much larger than in diastole, due to augmented pulsitility. In the normal subject, diastolic flow in the aorta is minimal (panel C); there is a prominent forward flow signal above the baseline and a small and brief signal of reversed diastolic flow below (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
