var title_f33_3_33850="Cardiac examination for VSD";
var content_f33_3_33850=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F56343&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F56343&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 642px\">",
"   <div class=\"ttl\">",
"    Cardiac examination for VSD",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 622px; height: 560px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Graphic illustration of the cardiac examination in ventricular septal defect (VSD).",
"    <br/>",
"    (A) Holosystolic murmur of VSD.",
"    <br/>",
"    (B) Shortened systolic murmur of muscular (VSD).",
"    <br/>",
"    (C) Typical murmur of VSD with mild pulmonary stenosis (PS) showing the delayed pulmonary closure sound (P",
"    <sub>",
"     2",
"    </sub>",
"    ).",
"    <br/>",
"    (D) Systolic ejection murmur of severe pulmonary stenosis with delayed and reduced P",
"    <sub>",
"     2",
"    </sub>",
"    .",
"    <br/>",
"    (E) Eisenmenger complex with absence of the holosystolic murmur of VSD (see text), a loud P",
"    <sub>",
"     2",
"    </sub>",
"    secondary to pulmonary hypertension, and pulmonary regurgitation (PR) diastolic murmur.",
"    <br/>",
"    (F) VSD murmur followed by diastolic murmur of aortic regurgitation (AR).",
"    <div class=\"footnotes\">",
"     S",
"     <sub>",
"      1",
"     </sub>",
"     : first heart sound; A",
"     <sub>",
"      2",
"     </sub>",
"     : aortic closure sound.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission Ammash N. Ventricular Septal Defects. In: Adult Congenital Heart Disease, Warnes, CA (Ed). &copy; 2009 American Heart Association, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
